import { GrayButton } from "../styles/Buttons";
import {
  ListFoodBox,
  ListButtonBox,
  ListHandleBox,
  ListHandleButtonBox,
} from "../styles/MyLists";
import { ButtonText, SerifText } from "../styles/TextStyles";
import { List1 } from "../testData/FoodData";
import { generateList } from "./functions/itemList";
import { priceAll } from "./functions/priceAll";
import { useState } from "react";
import { useNavigate } from "react-router-dom";
import { getString } from "../locales/languages/string";

export const MyListElementContent = ({ item, setData, setPopup }: any) => {
  const [active, setActive] = useState<boolean>(false);
  const navigate = useNavigate();

  return (
    <>
      <ListHandleBox theme={active}>
        <ListHandleButtonBox onClick={() => setActive(!active)}>
          <SerifText> {getString("temporary", "title1")}</SerifText>
          <SerifText>
            {getString("other", "value")} {priceAll(item)}
          </SerifText>
        </ListHandleButtonBox>
        {active ? (
          <ListFoodBox style={{ padding: "10px 10px 10px 0px" }}>
            {generateList(item, setData, "mode")}
            <ListButtonBox>
              <GrayButton
                onClick={() =>
                  setPopup({
                    isActive: TRUE,
                    message: "",
                    type: "WRITE",
                  })
                }
              >
                <ButtonText>{getString("buttons", "delete")}</ButtonText>
              </GrayButton>
              <GrayButton
                onClick={() =>
                  navigate("/OrderTransaction", {
                    state: {
                      cart: item,
                    },
                  })
                }
              >
                <ButtonText>{getString("buttons", "order")}</ButtonText>
              </GrayButton>
              <GrayButton
                onClick={() =>
                  navigate("/", {
                    state: {
                      item,
                    },
                  })
                }
              >
                <ButtonText>{getString("buttons", "addToCart")}</ButtonText>
              </GrayButton>
            </ListButtonBox>
          </ListFoodBox>
        ) : null}
      </ListHandleBox>
    </>
  );
};
